import React, {useState, useEffect} from 'react';
import { Route } from 'react-router-dom'

function ListElement ({cur}) {

    const imageStyle={
        width: 100,
        height: 100
    }

    return (
        <div  
            className="Container"
            style={imageStyle}
            >
            <h2>{cur.NAME}</h2>
            <img 
                src={cur.PICTURE}
            />
            <p>{cur.DETAIL}</p>
        </div>
    )
}
export default ListElement;
